Anywho...When I creeped on baking blogger @nourishedendeavors’ Instagram page after she liked my post about making Ina Garten’s Beatty’s Chocolate Cake in July, my eyes went straight to her picture of a gorgeous honey butter cake with fresh berries and spearmint. She had just posted the recipe to her website earlier that day, so I immediately bought a couple of missing items at the grocery store and baked it that evening. It’s AMAZING! The cake and the buttercream frosting are both light, fluffy and not too sweet. The fresh spearmint from my garden, blueberries and blackberries perfectly complemented the cake’s texture and flavor. Incredible. I’ll be trying Nourished Endeavors’ other recipes in the near future! Social media can be a cesspool of awful at times, but sometimes it’s a delight. ❤️

